import styles from "./display.module.css";

export default function CompanyItem(props){
    return (
        <div key={props.data?.id} className={styles.companyItem}>
            <div className={styles.companyName}><span className={styles.textOverflow}>{props.data?.name}</span></div>
            <div className={styles.companyDetails}>
            <div className={styles.companyEmployees}><span className={styles.textOverflow}>{props.data?.estimated_num_employees?props.data?.estimated_num_employees:'N/A'}</span></div>
            <div className={styles.companyLocation}><span className={styles.textOverflow}>{props.data?.city?props.data?.city:'N/A'}</span></div>
            <div className={styles.companyIndustry}><span className={styles.textOverflow}>{props.data?.industry?props.data?.industry:'N/A'}</span></div>
            <div className={styles.companyKeywords}><span className={styles.textOverflow}>{props.data?.keywords.join(", ")}</span></div>
            </div>
        </div>
    )
}
